import Header from '../components/Header';
import Footer from '../components/Footer';

const TNTT = () => (
    <>
    <Header/>
    <iframe title="thieu-nhi" style={{minHeight: "500px"}} className="center-50" height="100%" width="100%" src="https://www.tomathienatl.org"></iframe>
    <Footer/>
    </>
)

export default TNTT;
